import React, { Fragment } from "react";
import Card from "../components/Card";
import Search from "../components/Search";

const Home = () => {
  const cards = new Array(20).fill("").map((_, i) => i);
  console.log(cards);
  return (
    <Fragment>
      <Search />
      {cards.map((card, i) => {})}
      <div className="row mt-4">
        <div className="col-sm-4 mb-4">
          <Card />
        </div>
      </div>
    </Fragment>
  );
};

export default Home;
